           local duration = 10\
           local state= {\
               progressType = \"timed\",\
               soak = math.random(1, 2) == 1 and \"Soak Left\" or \"Soak Right\",\
               duration = duration,\
               expirationTime = duration+GetTime(),\
               presoak = math.random(1, 2) == 1,\
